import React from 'react';
import { Link } from 'react-router-dom';

function SmallMenu({ name }) {
  return (
    <li>
      {/* 내 정보 */}
      {name === '프로필' && <Link to="/"></Link>}
      {name === '찜한 목록' && <Link to="/">찜한 목록</Link>}
      {name === '내 후기 목록' && <Link to="/">내 후기 목록</Link>}
      {/* 검색 */}
      {name === '종류별' && <Link to="/mapfoodtype">종류별</Link>}
      {name === '지역별' && <Link to="/mapfoodsh">지역별</Link>}
      {name === '키워드별' && <Link to="/mapfoodkeyword">키워드별</Link>}
      {/* 게시판 */}
      {name === '전체' && <Link to="/boardall">전체</Link>}
    </li>
  );
}

export default SmallMenu;
